-- SOUND
	function poke_waveform(address, data)
			-- update this so parameters are: (channel, wave)
			for i,v in ipairs(data)
			do
				poke4(address*2+i-1, v)
			end
		end

Button = {
		Up    = 0,
		Down  = 1,
		Left  = 2,
		Right = 3,
		A     = 4,
		B     = 5,
		C     = 6,
		D     = 7
	}

function get_joy_vector_cardinal()
	local x = 0
	local y = 0

	if btn(Button.Right) then
		x = 1
	elseif btn(Button.Left) then
		x = -1
	elseif btn(Button.Down) then
		y = 1
	elseif btn(Button.Up) then
		y = -1
	end

	return Vector2.new(x, y)
end

